import { combineReducers } from 'redux'

function login(state = [], action) {
  switch (action.type) {
    case "LOGIN_AUTH":
      return [
        ...state,
        {
          userName: action.userName,
          password: action.userName
        }
      ]
    default:
      return state
  }
}
const todoApp = combineReducers({
  login
})
export default todoApp
